const UsersProfile =() =>{
    return(
        <div class>
            <div className="box">
                <p>Name: John Doe</p>
                <p>Age : 25</p>
                <p>Contact: 9876543210</p>
                <p>Email Id: johndoe@123.com</p>
                <p>Gender: : Male</p>
                <p>Rating: 4.5</p>
            </div>
        </div>
    )
}

export default UsersProfile;
